import React, { useEffect, useState } from 'react'; 

function Fetchtable(){
    const [rec,setRec]=useState([]);
    useEffect(() => {
        fetch('localhost:5050/api/call/userinfo/')
          .then(response => response.json())
          .then(data => set(data))
          .catch(error => {console.log(error)});
      }, []);
    return(
<table>
    <thead>
        <tr>
            <th>Email</th>
            <th>FirstName</th>
            <th>LastName</th>
            <th>Mobile</th>
            <th>DOB</th>
            <th>Action</th>
        </tr>
    </thead>
    <tbody>
        {
            rec.map((user,index)=>{
                <tr key={index}>
                    <td>{user.email}</td>
                    <td>{user.firstname}</td>
                    <td>{user.lastname}</td>
                    <td>{user.mobile}</td>
                    <td>{user.dob}</td>
                    <td><button>Edit</button><button>Delete</button></td>
                </tr>
            })
        }
    </tbody>
</table>
    )
}
export default Fetchtable;
